    // nested function
    function getPage(){
    const route = window.location.pathname; 
    if(route === '/about') return <AboutPage />;   
    return <HomePage/>;
    }
    <div className = "container-fluid">
        <Header/>
        return  getPage();
    </div>
}

export default App;
